import React from "react";

const estados = [
  {
    id: 1,
    estado: "pendiente",
  },
  {
    id: 2,
    estado: "entregado",
  },
];
export default function Estado() {
  return (
    <>
      {estados.map((estado) => {
        return <option key={estado.id}>{estado.estado}</option>;
      })}
    </>
  );
}
